import React from 'react';
import { HashRouter as Router, Route, Link } from "react-router-dom";
import ScrollAnim from 'rc-scroll-anim';
import content from './SectionsContent';
import iniciaScroll from './Scroll';
import Twn from './Twn';
import Transition from './Transition';
import CallDialog from './Dialog';
const ScrollOverPack = ScrollAnim.OverPack;

const find = id => content.find(p => p.id === id);

const OverPack = ({data}) => {
    let n = find(data.params.id);

    return (
        <div>
        <ScrollOverPack
            always={true}
            appear={true}
            className={n.classe}
            id={n.hash}
            data={'dial'+n.id}
            playScale={0.5}>
            {Twn({n: n, key: 'tweenOne2', reverse: true})}
            {Transition({n: n, key: 'tweenOne', reverse: true})}
        </ScrollOverPack>

<ScrollOverPack
always={true}
appear={true}
playScale={0.5}
id={'dial'+n.id}
className='dial'
        style={{ position: 'fixed', height: '100vh',top: 0, zIndex: 1300 }}
>
<CallDialog
d={{
    p: {
        a: n.id
    }
}}/>
</ScrollOverPack>
</div>
    )
}
class Home extends React.Component {
    componentDidMount() {
        iniciaScroll();
    }
    render() {

        return (content.map((i) => (
                <OverPack
                    data={{
                    params: {
                        id: i.id
                    }
                }}/>
        )));
    }
}

export default Home;
